export function ProductList(props) {
    console.log(props)
    return <div className="col-md-6">
        <h3>Praducts</h3>
        <div className="row">
            {
                props.data.map(elm => {
                    return <div className="col-md-3" key={elm.id} >
                        <p>{elm.title}</p>
                        
                        <button onClick={() => props.onDelete(elm.id)}>Dalete</button>


                    </div>
                })
            }

        </div>
    </div>
}






